import { useState } from "react";
import { ListHandleBox } from "../styles/MyLists";
import { generateList } from "./functions/itemList";

export const MyListsElementBox = (props: any) => {
  const [active, setActive] = useState<boolean>(false);
  return (
    <ListHandleBox onClick={() => setActive(!active)} theme={active}>
      {active ? generateList(props.data, props.setCart, "mode") : null}
    </ListHandleBox>
  );
};
